-- ----------------------------
-- Function structure for distance_calc
-- ----------------------------
DROP FUNCTION IF EXISTS `distance_calc`;
DELIMITER ;;
CREATE DEFINER=`tomeetuser`@`%` FUNCTION `distance_calc`( longitude1 double,  latitude1 double, longitude2 double,latitude2 double) RETURNS double
BEGIN  
  DECLARE PI double;
  DECLARE R int;
  DECLARE x double;
  DECLARE y double;
  DECLARE distance double;
	set PI=3.14159265358979323;
	set R=6371229;
	set x = (longitude2 - longitude1) * PI * R * cos(((latitude1 + latitude2) / 2) * PI / 180) / 180;
	set	y = (latitude2 - latitude1) * PI * R / 180;
	set	distance = pow(POW(x,2)+POW(y,2),0.5);
	return distance/1000;
END
;;
DELIMITER ;
SET FOREIGN_KEY_CHECKS=1;
